import React from 'react';

const GradCAMVisualization = ({ original, gradcam }) => {
  return (
    <div className="gradcam-visualization">
      <h4 className="font-bold mb-2">Grad-CAM Visualization</h4>
      <div className="grid grid-cols-2 gap-2">
        <div>
          <p className="text-sm mb-1">Original</p>
          <img
            src={`data:image/png;base64,${original}`}
            alt="Original"
            className="rounded shadow"
          />
        </div>
        <div>
          <p className="text-sm mb-1">Grad-CAM</p>
          <img
            src={`data:image/png;base64,${gradcam}`}
            alt="Grad-CAM"
            className="rounded shadow"
          />
        </div>
      </div>
    </div>
  );
};

export default GradCAMVisualization;
